in_source: |-
  limit:
    .word 4000000
  par_check:
    .word 1
  prev:
    .word 1
  cur:
    .word 2
  tmp:
    .word 0
  result:
    .word 0
  out_port:
    .word 2

  _start:
    load tr1 cur
    load tr2 limit
    cmp tr2 tr1
    jg _end
    load tr2 par_check
    test tr1 tr2
    jne _next_turn
    load tr3 result
    add tr3 tr1
    store tr3 result
    _next_turn:
        load tr1 cur
        store tr1 tmp
        load tr2 prev
        add tr1 tr2
        store tr1 cur
        load tr1 tmp
        store tr1 prev
        jmp _start
    _end:
        load tr3 result
        store tr3 (out_port)
    halt
